import React, { useState, useEffect } from 'react';

// UTC zaman objesini HH:MM:SS formatına çevirir
const formatTime = (timeObj) => {
    if (!timeObj) return "N/A";
    const pad = (num) => String(num).padStart(2, '0');
    return `${pad(timeObj.saat)}:${pad(timeObj.dakika)}:${pad(timeObj.saniye)}`;
};

const SERVER_BASE_URL = 'http://localhost:5003/api'; // Port 5003

const ControlPanel = ({ uavPositions }) => { 
    const activeUAVCount = uavPositions.length;

    // YENİ STATE'LER: Kayıtları tutmak için
    const [kilitlenmeRecords, setKilitlenmeRecords] = useState([]);
    const [kamikazeRecords, setKamikazeRecords] = useState([]);

    // --- POLLING MEKANİZMASI (Her 5 saniyede bir kayıtları Server'dan çeker) ---
    useEffect(() => {
        const fetchRecords = () => {
            // Kilitlenme Kayıtlarını Çekme
            fetch(`${SERVER_BASE_URL}/kilitlenme_kayitlari`)
                .then(res => res.json())
                .then(data => setKilitlenmeRecords(data.reverse())) // En yeniyi üste almak için ters çevir
                .catch(err => console.error("Kilitlenme çekilemedi:", err));

            // Kamikaze Kayıtlarını Çekme
            fetch(`${SERVER_BASE_URL}/kamikaze_kayitlari`)
                .then(res => res.json())
                .then(data => setKamikazeRecords(data.reverse())) // En yeniyi üste almak için ters çevir
                .catch(err => console.error("Kamikaze çekilemedi:", err));
        };

        fetchRecords(); 
        const interval = setInterval(fetchRecords, 5000); // Her 5 saniyede bir tekrarla

        return () => clearInterval(interval);
    }, []); 

    const totalRecords = kilitlenmeRecords.length + kamikazeRecords.length;

    return (
        <div style={{ padding: '10px' }}>
            {/* 1. Canlı Telemetri Özeti */}
            <h3 style={{ borderBottom: '1px solid #34495e', paddingBottom: '5px', color: '#2ecc71' }}>
                Canlı Telemetri Özeti ({activeUAVCount} İHA)
            </h3>
            <ul style={{ listStyle: 'none', padding: 0, fontSize: '14px' }}>
                {uavPositions.map(uav => (
                    <li key={uav.num} style={{ marginBottom: '10px', padding: '8px', backgroundColor: '#34495e', borderRadius: '4px' }}>
                        <strong style={{ color: '#f1c40f' }}>Takım {uav.num}</strong>: 
                        <br/>
                        Enlem/Boylam: <span style={{ color: '#ecf0f1' }}>{uav.lat.toFixed(5)}, {uav.lng.toFixed(5)}</span><br/>
                        İrtifa: <span style={{ color: '#e74c3c' }}>{uav.irtifa}m</span>
                    </li>
                ))}
                {activeUAVCount === 0 && <li style={{ color: '#e74c3c', marginTop: '10px' }}>Henüz telemetri verisi alınmadı.</li>}
            </ul>

            {/* 2. GÖREV KAYITLARI LİSTESİ */}
            <h3 style={{ marginTop: '20px', borderBottom: '1px solid #34495e', paddingBottom: '5px', color: '#2ecc71' }}>
                Kilitlenme & Kamikaze Kayıtları
            </h3>

            <p style={{ fontSize: '14px', color: '#bdc3c7' }}>
                *Toplam Kayıt: {totalRecords}*
            </p>

            <ul style={{ listStyle: 'none', padding: 0, fontSize: '12px', maxHeight: '300px', overflowY: 'auto' }}>
                {/* Kilitlenme Listesi */}
                {kilitlenmeRecords.map((rec, index) => (
                    <li key={`lock-${index}`} style={{ padding: '4px 0', borderLeft: '3px solid #3498db', paddingLeft: '5px', marginBottom: '4px' }}>
                        <strong style={{ color: '#3498db' }}>[KİLİTLENME]</strong> Bitiş: {formatTime(rec.kilitlenmeBitisZamani)} | 
                        Otonom: {rec.otonom_kilitlenme === 1 ? 'EVET' : 'HAYIR'} 
                    </li>
                ))}

                {/* Kamikaze Listesi */}
                {kamikazeRecords.map((rec, index) => (
                    <li key={`kami-${index}`} style={{ padding: '4px 0', borderLeft: '3px solid #e74c3c', paddingLeft: '5px', marginBottom: '4px' }}>
                        <strong style={{ color: '#e74c3c' }}>[KAMIKAZE]</strong> Başlangıç: {formatTime(rec.kamikazeBaslangicZamani)} |
                        Metin: {rec.qrMetni}
                    </li>
                ))}

                {totalRecords === 0 && <li style={{ color: '#e74c3c', marginTop: '10px' }}>Henüz görev kaydı bulunamadı.</li>}
            </ul>

        </div>
    );
};

export default ControlPanel;
